function uuid() {
  const randomHex = () => Math.floor(Math.random() * 16).toString(16);
  return "xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx".replace(/[xy]/g, function(c) {
    const r = randomHex();
    const v = c === "x" ? r : r & 3 | 8;
    return v.toString(16);
  });
}
